import { Router } from "express";
import {methods as languageControllers} from "../controllers/language.controllers"

const router=Router();

router.get("/get_all", languageControllers.getLanguages);
router.get("/get/:id", languageControllers.getLanguage);
router.post("/add", languageControllers.addLanguage);
router.delete("/delete/:id", languageControllers.deleteLanguage);
router.put("/update/:id", languageControllers.updateLanguage);


export default router;

